import React from "react";
import PropTypes from "prop-types";
import { Link } from "react-router-dom";
import Card from "pnnl-react-core/lib/Card";
import Grid from "react-bootstrap/es/Grid";
import Row from "react-bootstrap/es/Row";
import Col from "react-bootstrap/es/Col";
//import { Col, Row } from "react-bootstrap";
import LHSPlot from "./LHSPlot";
import LCSPlot from "./LCSPlot";
import LCFPlot from "./LCFPlot";
import ELFPlot from "./ELFPlot";
import CVGPlot from "./CVGPlot";
import Action from "pnnl-react-core/lib/Action";
import ActionBar from "pnnl-react-core/lib/ActionBar";
import PageItem from "react-bootstrap/es/PageItem";
import Pagination from "react-bootstrap/es/Pagination";

var tm30_data;

class Report extends React.Component {
  constructor(props) {
    super(props);
    this.pageChanged = this.pageChanged.bind(this);
    this.active = null;
    this.items = [];
    this.basic = "Basic";
    this.numerical = "Numerical";
    this.simple = "Simple";
    this.graphical = "Graphical";
    this.intermediate = "Intermediate";
    this.full = "Full";
    /*
    this.items.push(
      <Pagination.Item key={basic} active={basic === this.active}>
        {basic}
      </Pagination.Item>
    );
    this.items.push(
      <Pagination.Item key={graphical} active={graphical === this.active}>
        {graphical}
      </Pagination.Item>
    );
    this.items.push(
      <Pagination.Item key={numerical} active={numerical === this.active}>
        {numerical}
      </Pagination.Item>
    );
    this.items.push(
      <Pagination.Item key={simple} active={simple === this.active}>
        {simple}
      </Pagination.Item>
    );
    this.items.push(
      <Pagination.Item key={intermediate} active={intermediate === this.active}>
        {intermediate}
      </Pagination.Item>
    );
    this.items.push(
      <Pagination.Item key={full} active={full === this.active}>
        {full}
      </Pagination.Item>
    );
    */
  }

  pageChanged(e) {
    console.log(e.target.text);
    this.active = e.target.text;
    console.log(this.active === this.basic);
    console.log(this.active === this.graphical);
    console.log(this.active === this.numerical);
    console.log(this.active === this.simple);
    console.log(this.active === this.intermediate);
    console.log(this.active === this.full);
  }

  render() {
    return (
      <div>
        <h1>Report Page</h1>
        <br />
        {!(this.props.location.state == null) ? (
          <div>
            {
              // <ResultsTable data={this.props.location.state.data} />
            }
          </div>
        ) : (
          <Card>
            <h2>No data Calculated</h2>
            <h5>
              <ol>
                <li>Click on Calculator above</li> <br />
                <li>Choose which way to calculate data</li> <br />
                <li>Click Calculate and you will be redirected here</li>
              </ol>
            </h5>
          </Card>
        )}
        {!(this.props.location.state == null) ? (
          <Grid>
            {console.log(this.props.location.state.data)}
            <Row>
              <Col xs={4}></Col>
              <Col xs={4}>
                <h2 align="center">Basic Results</h2>
              </Col>
              <Col xs={4}></Col>
            </Row>
            <Row>
              <Col align="center">
                <Pagination onClick={this.pageChanged}>
                  <Pagination.Item
                    key={this.basic}
                    active={this.basic === this.active}
                  >
                    {this.basic}
                  </Pagination.Item>
                  <Pagination.Item
                    key={this.graphical}
                    active={this.graphical === this.active}
                  >
                    {this.graphical}
                  </Pagination.Item>
                  <Pagination.Item
                    key={this.numerical}
                    active={this.numerical === this.active}
                  >
                    {this.numerical}
                  </Pagination.Item>
                  <Pagination.Item
                    key={this.simple}
                    active={this.simple === this.active}
                  >
                    {this.simple}
                  </Pagination.Item>
                  <Pagination.Item
                    key={this.intermediate}
                    active={this.intermediate === this.active}
                  >
                    {this.intermediate}
                  </Pagination.Item>
                  <Pagination.Item
                    key={this.full}
                    active={this.full === this.active}
                  >
                    {this.full}
                  </Pagination.Item>
                </Pagination>
              </Col>
            </Row>
            <Row>
              <Col xs={7}>
                {" "}
                <Card>
                  <ELFPlot
                    test={
                      this.props.location.state.data.tm30.Numerical_Results
                        .normalized_SPD_test
                    }
                    ref_spd={
                      this.props.location.state.data.tm30.Numerical_Results
                        .normalized_SPD_ref
                    }
                  ></ELFPlot>
                </Card>
              </Col>

              <Col xs={5}>
                <Card>
                  <LCSPlot
                    data={
                      this.props.location.state.data.tm30.Numerical_Results
                        .local_chroma_shift
                    }
                  ></LCSPlot>
                </Card>
              </Col>
            </Row>

            <br />

            <Row>
              <Col xs={7}>
                <Card>
                  <CVGPlot
                    xtest={
                      this.props.location.state.data.tm30.Numerical_Results
                        .path_xtest
                    }
                    ytest={
                      this.props.location.state.data.tm30.Numerical_Results
                        .path_ytest
                    }
                    xref={
                      this.props.location.state.data.tm30.Numerical_Results
                        .path_xref
                    }
                    yref={
                      this.props.location.state.data.tm30.Numerical_Results
                        .path_yref
                    }
                    rf={
                      this.props.location.state.data.tm30.Numerical_Results.rg
                    }
                    rg={
                      this.props.location.state.data.tm30.Numerical_Results.rf
                    }
                    cct={
                      this.props.location.state.data.tm30.Numerical_Results
                        .CCT[0]
                    }
                    duv={
                      this.props.location.state.data.tm30.Numerical_Results
                        .DUV[0]
                    }
                  ></CVGPlot>
                </Card>
              </Col>
              <Col xs={5}>
                <Card>
                  <LHSPlot
                    data={
                      this.props.location.state.data.tm30.Numerical_Results
                        .local_hue_shift
                    }
                  ></LHSPlot>
                </Card>

                <br />

                <Card>
                  <LCFPlot
                    data={
                      this.props.location.state.data.tm30.Numerical_Results
                        .local_color_fidelity
                    }
                  ></LCFPlot>
                </Card>
              </Col>
            </Row>
          </Grid>
        ) : (
          /*
          <div class="reportImage">
            <ModalImage
              small="http://localhost:8000/tm30_output.png"
              large="http://localhost:8000/tm30_output.png"
              alt=""
            />
          </div>
        */
          <div></div>
        )}
      </div>
    );
  }
}

export default Report;
